<template>
  <div>
    <popup ref="popup">
      <div class="myqr">
        <img :src="myqrurl">
      </div>
      <img src="https://cdn.xingkwh.com/close-.png" @click="_closeresult" class="cancelimg">
    </popup>
    <interlayer ref="interlayer" @close="_closeresult"></interlayer>
    <canvas ref="spread" width="600" height="970" class="spread hidek" style="width: 300px; height: 485px;"></canvas>
    <img class="spreadqr hidek" ref="qrimg" @load="_setcanvas">
    <img class="spreadimg hidek" src="data:image/png;base64,"/>
  </div>
</template>

<script>
  import popup from 'base/popup/popup'
  import interlayer from 'base/interlayer/interlayer'
  import QRCode from 'qrcode'

  const SPREED = 'https://open.weixin.qq.com/connect/oauth2/authorize?appid=wx8c8084e0e0c2b623&redirect_uri=http%3a%2f%2fstars.xingkwh.com%2fdgz%2f%23%2findex'
  export default {
    name: 'poster',
    data() {
      return {
        myqrurl: null
      }
    },
    methods: {
      _closeresult() {
        this.$refs.popup._hiddenPopup()
        this.$refs.interlayer._hiddenLayer()
      },
      _setcanvas() {
        try {
          let canvas = document.querySelector('.spread')
          let imgbg = document.querySelector('.spreadimg')
          let imgqr = document.querySelector('.spreadqr')
          canvas.getContext('2d').drawImage(imgbg, 0, 0, 600, 970)
          canvas.getContext('2d').drawImage(imgqr, 185, 498, 230, 230)
          this.myqrurl = canvas.toDataURL('image/png')
          this.$root.eventHub.$emit('loading', null)
          this.$refs.popup._showPopup()
          this.$refs.interlayer._showLayer()
        } catch (err) {
          this.$root.eventHub.$emit('loading', null)
          console.log(err)
        }
      },
      _showqr() {
        if (this.myqrurl) {
          try {
            document.body.scrollTop = 0;
            document.documentElement.scrollTop = 0;
          } catch (e) {
            console.log(e)
          }
          this.$refs.popup._showPopup()
          this.$refs.interlayer._showLayer()
          return false
        }
        const opts = {
          type: 'image/jpeg'
        }
        this.$root.eventHub.$emit('loading', true)
        QRCode.toDataURL(`${SPREED}?username=${this.$root.user.lower_code}&response_type=code&scope=snsapi_userinfo#wechat_redirect`, opts, (err, url) => {
          if (err) {
            this.$root.eventHub.$emit('titps', '二维码解析出错')
            console.error(err)
          } else {
            this.$refs.qrimg.src = url
          }
        })
      }
    },
    components: {
      popup,
      interlayer
    },
  }
</script>

<style scoped>
  .myqr {
    width: 300px;
    height: 485px;
    overflow: hidden;
    margin: 0 auto;
  }

  .myqr img {
    width: 100%;
    height: 100%;
  }

  .cancelimg {
    display: block;
    transform: translate(0px, 68%);
    margin: 0 auto;
  }

  .hidek {
    opacity: 0;
    position: fixed;
    z-index: -99;
    top: 1000px;
    left: 0;
  }
</style>
